import React from "react";
import {FilterOperator as FilterOperatorType, SearchFilter as SearchFilterType} from "../types/searchFilters.type";
import {FilterPropertySelect} from "./filterPropertySelect.component";
import {ChangeFilter, Trigger} from "../types/methods.type";
import { FilterValueInput } from "./filterValueInput.components";
import {DeleteFilter} from "./deleteFilter.component";
import { FormControl } from "@mui/material";
import { FilterOperator } from "./filterOperator.component";
import {FilterProperty as FilterTypeType} from "../types/searchFilters.type";

export function SearchFilterComponent({searchFilter, changeFilter, deleteFilter}:{searchFilter:SearchFilterType, changeFilter:ChangeFilter, deleteFilter:Trigger}) {
    const {filterType,value,operator} = searchFilter;
    return <div>
        <FilterPropertySelect filterProperty={filterType} changeFilterType={(newType:FilterTypeType)=>changeFilter({filterType:newType,operator,value})}/>
        {filterType&&<FilterOperator filterType={filterType} operator={operator} changeOperator={(newOperator:FilterOperatorType)=>changeFilter({filterType,operator:newOperator,value})}/>}
        {filterType&&<FilterValueInput filterType={filterType} filterValue={value} changeFilterValue={(newValue:string)=>changeFilter({filterType,operator,value:newValue})}/>}
        <DeleteFilter deleteFilter={deleteFilter}/>
    </div>;
}
